  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-and-salinity-profiles-from-ctd-casts-from-the-noaa-ship-ronald-h-brown-in-the-se-pa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"CTD and other data were collected from
  NOAA Ship RONALD H. BROWN in the SE Pacific (limit-140 W) from from 01 February
  2001 to 08 March 2001. CTD data consist of temperature and salinity profiles. Profiles
  were collected by three programs: Equatorial Pacific Air-Sea CO2 Exchange Experiment
  (GASEX II), East Pacific Investigation of Climate Processes in the Coupled Ocean-Atmosphere
  System (EPIC 2001), and Global Ocean-Atmosphere-Land System (GOALS)/Pan American
  Climate Studies (PACS). Data were collected in support of gas flux measurements
  to improve our understanding of the forcing functions of the kinetics of air-sea
  gas exchange.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
